// Copied from https://www.callstack.com/blog/from-files-to-buffers-building-real-time-audio-pipelines-in-react-native
const wavHeaderLength = 44;

const createWAVHeader = (
    buffer: ArrayBuffer,
    dataLength: number,
    sampleRate: number,
    channels: number = 1,
    bitsPerSample: number = 16,
    isFloat: boolean = true): ArrayBuffer => {
    const view = new DataView(buffer)

    const byteRate = (sampleRate * channels * bitsPerSample) / 8
    const blockAlign = (channels * bitsPerSample) / 8

    // Helper function to write ASCII strings
    const writeString = (offset: number, str: string) => {
        for (let i = 0; i < str.length; i++) {
            view.setUint8(offset + i, str.charCodeAt(i))
        }
    }

    // WAV file header (44 bytes total)
    writeString(0, 'RIFF') // ChunkID
    view.setUint32(4, 36 + dataLength, true) // ChunkSize
    writeString(8, 'WAVE') // Format
    writeString(12, 'fmt ') // Subchunk1ID
    view.setUint32(16, 16, true) // Subchunk1Size (16 for PCM)
    view.setUint16(20, isFloat ? 3 : 1, true) // AudioFormat
    view.setUint16(22, channels, true) // NumChannels
    view.setUint32(24, sampleRate, true) // SampleRate
    view.setUint32(28, byteRate, true) // ByteRate
    view.setUint16(32, blockAlign, true) // BlockAlign
    view.setUint16(34, bitsPerSample, true) // BitsPerSample
    writeString(36, 'data') // Subchunk2ID
    view.setUint32(40, dataLength, true) // Subchunk2Size

    return buffer
}

export async function playBase64BCMAudio(
    base64AudioData: string, sampleRate: number) {
    const decodedAudio = atob(base64AudioData);
    console.log('decoded audio length: ', decodedAudio.length);
    const wavBuffer = new ArrayBuffer(wavHeaderLength + decodedAudio.length);
    createWAVHeader(wavBuffer, decodedAudio.length, sampleRate, 1, 16, false);

    const wavView = new Uint8Array(wavBuffer)
    for (let i = 0; i < decodedAudio.length; ++i) {
        wavView[i + wavHeaderLength] = decodedAudio.charCodeAt(i);
    }

    const audioContext = new AudioContext();
    const buffer = await audioContext.decodeAudioData(wavBuffer);
    const node = audioContext.createBufferSource();
    node.buffer = buffer;
    node.connect(audioContext.destination);
    node.start();
}
